(604, '2024-03-13 02:31:16', '2024-03-13 11:42:23', 'mod937', 'approved', 'Kerrie-Ann S', 'reason_change', 'vfobv@example.com', 3750, 15, '{\"meeting_name\":\"12 Steps to Recovery\",\"original_meeting_name\":\"NA - Step into Recovery\",\"original_start_time\":\"18:00:00\",\"original_duration_time\":\"01:00:00\",\"original_location_text\":\"Church of Nazarene\",\"original_location_street\":\"62 Svensson Street\",\"original_location_info\":\"Inside main building\",\"original_location_municipality\":\"Svensson Heights, Bundaberg\",\"original_location_province\":\"Queensland\",\"original_location_postal_code_1\":\"4670\",\"original_weekday_tinyint\":\"5\",\"original_service_body_bigint\":\"15\",\"original_format_shared_id_list\":\"7,17,27,30\",\"original_venue_type\":\"1\",\"original_published\":\"1\",\"contact_number\":\"0427519594\",\"group_relationship\":\"Group Member\",\"add_contact\":\"yes\",\"additional_info\":\"NA - Step into Recovery changed it\'s time to Thursday evenings 6 - 7pm.  There is no Monday night meeting anymore.\\r\\nNA _ Step into Recovery is NOW NAMED: 12 STEPS TO RECOVERY (as per group conscious).  Please change accordingly.  This is our third request to have meeting name changed.\"}', 'Hi Kerrie-Ann, the Monday meeting has now been deleted and the meeting name has been updated. In future could you please request the change for each meeting that you want to change rather than trying to capture the changes for both meetings in the one request. Yours in service Bruce G.'),
(605, '2024-03-14 19:05:55', '2024-03-14 22:26:25', 'user987', 'approved', 'Kevin Montoya', 'reason_new', 'pqqcccc@example.com', 0, 5, '{\"meeting_name\":\"Ice junkies\",\"start_time\":\"08:30:00\",\"duration_time\":\"02:30:00\",\"location_municipality\":\"West Sydney\",\"location_province\":\"Nsw\",\"location_postal_code_1\":\"2364\",\"weekday_tinyint\":\"6\",\"service_body_bigint\":5,\"format_shared_id_list\":\"3\",\"contact_number\":\"0492192793\",\"group_relationship\":\"Not A Member\",\"add_contact\":\"yes\",\"additional_info\":\"Yes I\\u2019ve been addicted to the Drug ice crystal methamphetamines for eight or nine years now. My name is Jemma Harrison I was born on the 27th of the seventh 1990 I would like as much supportive information on how to create the drug and the drug marijuana I\\u2019ve been smoking for more than five years. Please bring as much information on this as possible. Thank you kind regards Jemma Harrison.\",\"virtual_meeting_additional_info\":\"Meeting info: phbbYU\",\"phone_meeting_number\":\"0496994753\",\"starter_kit_required\":\"yes\",\"starter_kit_postal_address\":\"9 Pheasant Creek Rd, Wowan QLD 4702, Australia Enid makinlay and gordan makinlay\",\"venue_type\":2,\"published\":1}', 'Hi Jemma, we are a self-help group of recovering drug addicts, we help each other get and stay clean. If you ever want to stop , but find you can\'t stop, or stay stopped, or you swap one drug for another, NA may be useful to you. To find a meeting near you at a time that suits you, just use the meetings search function on the the na.org.au website. alternatively you can also find NA meetings online'),
